import {
    UniqueIdentifier,
} from '@dnd-kit/core';

import React, {useState} from 'react';

var parent : any;
var isDragging = false;
//export const [parent, setParent] = useState<UniqueIdentifier | null>(null);
//export const [isDragging, setIsDragging] = useState(false);

export function setParent(n : any) {
    parent = n;
}

export function getParent(n : any) {
    return parent;
}

export function setIsDragging(n : any) {
    return isDragging = n;
}

export function getIsDragging(n : any) {
    return isDragging;
}
